public class INTERSPERSE {
    public static List<Integer> intersperse(List<Integer> numbers, int delimeter) {
        List<Integer> result = new ArrayList<Integer>();

        if (numbers.size() == 0)
            return result;

        for (int i = 0; i < numbers.size(); i += 1) {
            result.add(numbers.get(i));
